import React from 'react';
import { Chart as ChartJS, RadialLinearScale, PointElement, LineElement, Filler, Tooltip, Legend } from 'chart.js';
import { Radar } from 'react-chartjs-2';

ChartJS.register(RadialLinearScale, PointElement, LineElement, Filler, Tooltip, Legend);

const ComparisonChart = ({ models }) => {
  const colors = [
    'rgba(255, 99, 132, 0.6)',
    'rgba(54, 162, 235, 0.6)',
    'rgba(255, 206, 86, 0.6)',
    'rgba(75, 192, 192, 0.6)',
    'rgba(153, 102, 255, 0.6)',
  ];

  const data = {
    labels: ['Accuracy', 'Speed', 'Cost Efficiency', 'Feature Set', 'Ease of Use'],
    datasets: models.map((model, index) => ({
      label: model.name,
      data: [
        model.accuracy,
        model.speed,
        6 - model.cost, // Invert cost to show as "cost efficiency"
        4.5, // Placeholder for feature set
        4.0, // Placeholder for ease of use
      ],
      backgroundColor: colors[index % colors.length],
      borderColor: colors[index % colors.length].replace('0.6', '1'),
      borderWidth: 1,
    })),
  };

  const options = {
    scales: {
      r: {
        min: 0,
        max: 5,
        ticks: {
          stepSize: 1,
          display: false,
        },
      },
    },
    plugins: {
      legend: {
        position: 'top',
      },
      tooltip: {
        callbacks: {
          label: function(context) {
            let label = context.dataset.label || '';
            if (label) {
              label += ': ';
            }
            if (context.raw !== undefined) {
              label += context.raw;
            }
            return label;
          },
        },
      },
    },
    maintainAspectRatio: false,
  };

  return (
    <div className="bg-white p-4 rounded-lg shadow-md">
      <h3 className="text-lg font-medium text-gray-900 mb-4">Model Comparison</h3>
      <div className="h-80">
        <Radar data={data} options={options} />
      </div>
      <div className="mt-4">
        <p className="text-xs text-gray-500 italic">
          Note: Feature Set and Ease of Use are estimated values based on general model characteristics.
        </p>
      </div>
    </div>
  );
};

export default ComparisonChart;
